import React from 'react';
import './inputstyle.css'; // Import the CSS file for styling

const Input = ({ label, value, onChange }) => {
    return (
        <div className="outlined-input-container">
            <input
                type="text"
                className="outlined-input"
                value={value}
                onChange={onChange}
            />
            <label className="outlined-label">{label}</label>
        </div>
    );
};

export default Input;
